import React, { useEffect, useState } from 'react';
import { onAuthStateChanged } from 'firebase/auth';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap-icons/font/bootstrap-icons.css';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { auth } from './firebase';
import RecipeForm from './components/RecipeForm';
import RecipeList from './components/RecipeList';
import LoginPage from './components/Authentication/LoginPage';
import RegisterPage from './components/Authentication/RegisterPage';
import Navbar from './components/Navbar';
import Loading from 'react-loading';

function App() {
  const [user, setUser] = useState(null);
  const [recipes, setRecipes] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    const unsubscribe = onAuthStateChanged(auth, (user) => {
      setUser(user);
      setIsLoading(false);
    });

    return () => {
      unsubscribe();
    };
  }, []);

  const handleAddRecipe = (newRecipe) => {
    setRecipes((prevRecipes) => [...prevRecipes, newRecipe]);
  };

  const handleEditRecipe = (id, updatedRecipe) => {
    setRecipes((prevRecipes) => {
      const updatedRecipes = prevRecipes.map((recipe) => {
        if (recipe.id === id) {
          return { ...recipe, ...updatedRecipe };
        }
        return recipe;
      });
      return updatedRecipes;
    });
  };

  const handleDeleteRecipe = (id) => {
    setRecipes((prevRecipes) => prevRecipes.filter((recipe) => recipe.id !== id));
  };

  const PrivateRoute = ({ element, authenticated, fallback }) => {
    return authenticated ? element : <Navigate to={fallback} replace />;
  };

  const GuardedRecipeList = () => {
    return (
      <PrivateRoute
        element={<RecipeList recipes={recipes} onEdit={handleEditRecipe} onDelete={handleDeleteRecipe} />}
        authenticated={user !== null}
        fallback="/login"
      />
    );
  };

  const GuardedRecipeForm = () => {
    return (
      <PrivateRoute
        element={<RecipeForm onSubmit={handleAddRecipe} />}
        authenticated={user !== null}
        fallback="/login"
      />
    );
  };

  const GuardedLoginPage = () => {
    return (
      <PrivateRoute
        element={<LoginPage setUser={setUser} />}
        authenticated={user === null}
        fallback="/"
      />
    );
  };

  const GuardedRegisterPage = () => {
    return (
      <PrivateRoute
        element={<RegisterPage setUser={setUser} />}
        authenticated={user === null}
        fallback="/"
      />
    );
  };

  return (
    <Router>
      <div className="container my-5">
        <div className="card p-4">
          <h1 className="mb-4">Recipe Book</h1>
          <Navbar user={user} />
          {isLoading ? (
            <div className="d-flex justify-content-center align-items-center">
              <Loading type="spin" color="#000" height={50} width={50} />
            </div>
          ) : (
            <Routes>
              <Route path="/" element={<GuardedRecipeList />} />
              <Route path="/add-recipe" element={<GuardedRecipeForm />} />
              <Route path="/login" element={<GuardedLoginPage />} />
              <Route path="/register" element={<GuardedRegisterPage />} />
            </Routes>
          )}
        </div>
      </div>
    </Router>
  );
}

export default App;
